import React, { useState } from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import { motion } from "framer-motion";

// Pages
import DigitalLandscapes from "./pages/DigitalLandscapes";
import PlaylistLocalization from "./pages/PlaylistLocalization";
import WebVerifyExpansion from "./pages/WebVerify";
import UnifiedAuth from "./pages/UnifiedAuth";

export default function App() {
  const [darkMode, setDarkMode] = useState(false);

  return (
    <Router>
      <div className={darkMode ? "bg-black text-white" : "bg-white text-black"}>
        <header className="h-screen flex flex-col items-center justify-center text-center px-4">
          <button
            onClick={() => setDarkMode(!darkMode)}
            className="absolute top-6 right-6 px-4 py-2 rounded-full border"
          >
            {darkMode ? "Light Mode" : "Dark Mode"}
          </button>

          <motion.h1
            className="text-6xl font-extrabold tracking-tight"
            initial={{ opacity: 0, y: 40 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
          >
            Yaz Liu
          </motion.h1>
          <motion.p
            className="mt-6 text-lg max-w-xl"
            initial={{ opacity: 0, y: 20 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 0.4, duration: 0.8 }}
          >
            Product designer focused on turning complexity into clarity. I build
            systems, elevate design ops, and scale meaningful experiences.
          </motion.p>
          <a
            href="/resume.pdf"
            download
            className="mt-8 inline-block px-6 py-2 border rounded-full text-sm hover:bg-gray-200 hover:text-black"
          >
            Download Resume
          </a>
        </header>

        <Routes>
          <Route
            path="/"
            element={
              <main className="max-w-4xl mx-auto px-4 pb-24">
                <section className="mb-24">
                  <motion.h2
                    className="text-4xl font-bold mb-12"
                    initial={{ opacity: 0 }}
                    whileInView={{ opacity: 1 }}
                    transition={{ duration: 0.6 }}
                    viewport={{ once: true }}
                  >
                    About
                  </motion.h2>
                  <p className="mb-16">
                    I’ve worked across industries and problem spaces — from
                    helping government teams improve access to digital services,
                    to enabling global music editors to localize content at
                    scale. Whether I'm building from 0–1 or scaling a system, I
                    focus on clarity, collaboration, and designing for
                    real-world complexity.
                  </p>

                  <motion.h2
                    className="text-4xl font-bold mb-12"
                    initial={{ opacity: 0 }}
                    whileInView={{ opacity: 1 }}
                    transition={{ duration: 0.6 }}
                    viewport={{ once: true }}
                  >
                    Case Studies
                  </motion.h2>

                  <div className="space-y-16">
                    <CaseStudy
                      title="Digital Landscapes Redesign"
                      company="Walmart · 2024–2025"
                      link="/case-studies/digital-landscapes"
                    />
                    <CaseStudy
                      title="Playlist Localization Tool"
                      company="Spotify · 2021–2022"
                      link="/case-studies/playlist-localization"
                    />
                    <CaseStudy
                      title="WebVerify i18n Expansion"
                      company="CLEAR · 2021"
                      link="/case-studies/webverify-expansion"
                    />
                    <CaseStudy
                      title="Unified Authentication"
                      company="CLEAR · 2023–2024"
                      link="/case-studies/unified-auth"
                    />
                  </div>
                </section>
              </main>
            }
          />

          <Route
            path="/case-studies/digital-landscapes"
            element={<DigitalLandscapes />}
          />
          <Route
            path="/case-studies/playlist-localization"
            element={<PlaylistLocalization />}
          />
          <Route
            path="/case-studies/webverify-expansion"
            element={<WebVerifyExpansion />}
          />
          <Route path="/case-studies/unified-auth" element={<UnifiedAuth />} />
        </Routes>

        <footer className="text-center text-sm py-8 border-t">
          <p className="text-gray-400">&copy; 2025 Yaz Liu</p>
        </footer>
      </div>
    </Router>
  );
}

function CaseStudy({ title, company, link }) {
  return (
    <motion.div
      className="border border-gray-300 p-6 rounded-2xl hover:bg-gray-100 hover:text-black transition-colors duration-300"
      initial={{ opacity: 0, y: 40 }}
      whileInView={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.6 }}
      viewport={{ once: true }}
    >
      <Link to={link}>
        <h3 className="text-2xl font-semibold mb-1">{title}</h3>
        <p className="text-sm text-gray-500">{company}</p>
      </Link>
    </motion.div>
  );
}
